seqr.set_arbitration(); Specifies the arbitration mode for the sequencer. function void set_arbitration(
UVM_SEQ_ARB_TYPE val
) Arbitration Order UVM_SEQ_ARB_FIFO (default) Requests are granted in FIFO order UVM_SEQ_ARB_WEIGHTED Requests are granted randomly by weight UVM_SEQ_ARB_RANDOM Requests are granted randomly UVM_SEQ_ARB_STRICT_FIFO Requests at highest priority granted in FIFO order UVM_SEQ_ARB_STRICT_RANDOM Requests at highest priority granted in randomly UVM_SEQ_ARB_USER Arbitration is delegated to the user-defined function, user_priority_arbitration. That function will specify the next sequence to grant.
